import React from "react";
import DeleteIcon from '@mui/icons-material/Delete';

const ToDo = (props)=>{
    return(
        <>
        <div >
        <span 
        id="listB" 
        className='btn_align' 
        onClick={()=>{
            props.onselect(props.id)
         }}>

         <DeleteIcon/>
         </span>
         
         <li>  {props.text}</li> <br/>
        
       
        </div>

        </>
    )
}

export default ToDo;
